// Home screen
// @author: @rishisant
// @date: 2022-12-11

import {useNavigate} from 'react-router-dom';
import React from 'react';
import './BaseStyle.css';
// import {raise_admin_bar} from './HomeFunctions';
import {alert_console} from './HomeFunctions';


const Home = () => {
    const navigate = useNavigate();

    return (
        <div id="homecontainer">
            <img id="mainlogo" src={require('./components/img/hss_transparent.png')} alt="Logo"></img>
            <div class="homebutton" id="to_order" onClick={() => navigate('/Accessibility')}>Start Your Order</div>
            <div class="homebutton" id="admin_panel" onClick={alert_console}>Admin Panel</div>


            <div id="adminpanel">
                <panelbig>ADMIN PANEL</panelbig>
                <img class="admin_button" id="managerlogo" src={require('./components/img/manager_transparent.png')} alt="Manager Logo"></img>
                <paneltext>MANAGER</paneltext>
                <img class="admin_button" id="serverlogo" src={require('./components/img/server_transparent.png')} alt="Server Logo"></img>
                <paneltext>SERVER</paneltext>
                {/* <img class="admin_button" id="reportslogo" src={require('./components/img/reports_transparent.png')}></img> */}
            </div>
        </div>

    )

};
export default Home;
